    false,nt"url": null,nt"notes": "The Statewide GIS Tax Unit boundary file
    was created through a collaborative partnership between the State of Kansas Department
    of Revenue Property Valuation Division, the Kansas GIS Policy Board's Data Access
    & Support Center (DASC), and Kansas County Clerks. During 2010, tax unit boundary
    information was gathered from Kansas County Clerks by DASC and resulted in the first
    statewide GIS tax unit boundary data file. Certifications are on-going and are integrated
